/* Page Script */
/* Author: AtulBhatS http://atulbhats.com */

$icons = {
		home:'assets/icons/home.png',
		back:'assets/icons/back.png',
		menu:'assets/icons/menu.png',
		about:'assets/icons/about.png',
		artwork:'assets/icons/artwork.png',
		contact:'assets/icons/contact.png'
}

$windowWidth = $(window).width();
$windowHeight = $(window).height();
$defaultBottom=0;
$defaultRight=0;

$modal={
	about:0,
	artwork:0,
	contact:0,
}

$modalArray=["about","artwork","contact"];
//$iconArray=["info","camera","paint-brush","phone"];

function min($a,$b){
	return ($a<$b)?$a:$b;
}

function ucfirst($string){
	$a=$string.substr(0,1);
	$b=$string.substr(1);
	return $a.toUpperCase()+$b;
}

function resetIcons(){
	for($z=0;$z<4;$z++){
		$c=$modalArray[$z];
		$('#'+$c+'-modal-trigger').find('.icon').attr('src',$icons[$c]);	
		$('#'+$c+'-modal-trigger').find('span').text(ucfirst($c));	
	}
}

function openModal($ids){
	for($z=0;$z<4;$z++){
		if($modalArray[$z] != $ids){
			if($('#'+$modalArray[$z]+'-modal').hasClass('visible')){
				$('#'+$modalArray[$z]+'-modal').find('.modal-close').click();
			}
			$modal[$modalArray[$z]]=0;
		}
	}
	if(parseInt($(document).width())<768){
		resetIcons();
	}
	if($modal[$ids]==0){
		$('#'+$ids+'-transition').addClass('visible opening');
		var delay = ( $('.no-cssanimations').length > 0 ) ? 0 : 600;
		setTimeout(function(){
			$('#'+$ids+'-modal').addClass('visible');
		}, delay);
		for($z=0;$z<4;$z++){
			if($modalArray[$z]==$ids){
				$icon=$icons[$modalArray[$z]];
				break;
			}
		}
		if($windowWidth<768){
			$('#'+$ids+'-modal-trigger').find('.icon').attr('src',$icons['home']);
			$('#'+$ids+'-modal-trigger').find('span').text('Home');	
		}
		$modal[$ids]=1;
		setTimeout(function(){
			$('.nav-toggle').find('.icon').attr('src',$icons['back']);
		},700);
	}
	else{
		$modal[$ids]=0;
		closeModal($ids);
	}
}

function closeModal($ids){
	$('#'+$ids+'-transition').addClass('closing');
	$('#'+$ids+'-modal').removeClass('visible');
	$('#'+$ids+'-transition').find('.bg-layer').one('webkitAnimationEnd oanimationend msAnimationEnd animationend', function(){
		$('#'+$ids+'-transition').removeClass('closing opening visible');
		$('#'+$ids+'-transition').find('.bg-layer').off('webkitAnimationEnd oanimationend msAnimationEnd animationend');
	});
	resetIcons();
	setTimeout(function(){
			$('.nav-toggle').find('.icon').attr('src','');
			$('.nav-toggle').find('.icon').attr('src',$icons['menu']);
	},700);
}

jQuery(document).ready(function($){

	$(".nav-toggle" ).draggable();

	var frameProportion = 1.78, //png frame aspect ratio
		frames = 25, //number of png frames
		resize = false;

	//set transitionBackground dimentions
	setLayerDimensions();
	$(window).on('resize', function(){
		if( !resize ) {
			resize = true;
			(!window.requestAnimationFrame) ? setTimeout(setLayerDimensions, 300) : window.requestAnimationFrame(setLayerDimensions);
		}
	});

	function setLayerDimensions() {
		var windowWidth = $(window).width(),
			windowHeight = $(window).height(),
			layerHeight, layerWidth;

		if( windowWidth/windowHeight > frameProportion ) {
			layerWidth = windowWidth;
			layerHeight = layerWidth/frameProportion;
		} else {
			layerHeight = windowHeight*1.2;
			layerWidth = layerHeight*frameProportion;
		}

		for($z=0;$z<4;$z++){
			$c=$modalArray[$z];
			$('#'+$c+'-transition').find('.bg-layer').css({
				'width': layerWidth*frames+'px',
				'height': layerHeight+'px',
			});	
		}
	
		resize = false;
	}
	
	$(window).on('resize', function(){
		repositionNav();
	});

	repositionNav();
	
	function repositionNav(){
		var windowWidth = $(window).width(),
			windowHeight = $(window).height();
		if(parseInt(windowWidth)<768){
			$defaultBottom='-60px';
			$defaultRight='-60px';
			$('.nav-item').css({
			  'right':$defaultRight,  
			  'bottom':$defaultBottom
			});
			positionDialogue();
			$('#dialogue').show();
			setTimeout(function(){
				$('#dialogue').fadeOut();
			},10000);
		}
		else{
			contractMenu();
			$('.nav-item span').css({
				'color':'#000'
			});
		}
	}

	function positionDialogue(){
		var windowWidth = $(window).width(),
			windowHeight = $(window).height();
		$nl=parseInt($('.nav-toggle').css('left'));
		$nt=parseInt($('.nav-toggle').css('top'));

		$('#dialogue,#dialogue .caret').css({
			'top':'auto',
			'left':'auto',
			'right':'auto',
			'bottom':'auto'
		});
		if($nl<(windowWidth/2)){
			$('#dialogue').css({
				'right':'-120px'
			});
			$('#dialogue .caret').css({
			    'left': '-7px',
    			'transform': 'rotate(90deg)'
			});
		}
		else{
			$('#dialogue').css({
				'left':'-120px'
			});
			$('#dialogue .caret').css({
			    'right': '-6px',
    			'transform': 'rotate(270deg)'
			});
		}
		if($nt<(windowHeight/2)){
			$('#dialogue').css({
				'top':'20px'
			});
			$('#dialogue .caret').css({
				'top': '20%'
			});
		}
		else{
			$('#dialogue').css({
				'top':'-20px'
			});
			$('#dialogue .caret').css({
				'bottom': '20%'
			});
		}	
	}

	$('.nav-toggle,.nav-item').click(function(e){
		$left=$(document).width();
		if($left<768){
			if($('.nav-item').css('bottom')==$defaultBottom){
				expandMenu();
			}
			else{
				contractMenu();
			}

		}
	});

	$('.nav-item').click(function(e){
		//e.preventDefault();
		$ids=$(this).attr('id');
		$ids=$ids.replace("-modal-trigger","");
		openModal($ids);
	});
	
	$('.modal-close').click(function(e){
		//e.preventDefault();
		$ids=$(this).parent().attr('id').replace("-modal","");
		closeModal($ids);
	});

	function expandMenu(){
		$r=175;
		$offset=75;
		$c=$('.nav-item').length;
		$boxShadow=$('.nav-toggle').css('box-shadow');
		for($z=0;$z<$c;$z++){
			$y=$c-$z;
			$bt=$r*(Math.cos(((90/($c-1))*$z)*((22/7)/180)));
			$rt=$r*(Math.cos((90-((90/($c-1))*$z))*((22/7)/180)));
			$('.nav-item:nth-child('+($z+1)+')').velocity({
				'bottom': parseInt($defaultBottom)+($offset)+($bt)+'px',
				'right': parseInt($defaultRight)+($offset)+($rt)+'px'
			},500);
			$('.nav-item:nth-child('+($z+1)+')').css({
				'box-shadow': '0px 2px 10px #000'
			});
		}
		$('main,footer,.artista-modal').velocity({'opacity':'0.5'});
		$('.nav-item span').css({
			'color':'#000'
		});
		
	}

	function contractMenu(){
		$('.nav-item').velocity({
			'bottom': $defaultBottom,
			'right': $defaultRight
		},500);
		$('.nav-item').css({
			'box-shadow': 'none'
		});
		$('main,footer,.artista-modal').velocity({'opacity':'1'});
		$('.nav-item span').css({
			'color':'transparent'
		});
	}

	$('body').keyup(function(e){
		if(e.which==27){
			$ids=$('body').find('.artista-modal.visible').attr('id').replace('-modal','');
			closeModal($ids);
		}
		else if(e.which==77){
			$('.nav-toggle').click();
		}
	});

	$z=0;

	$w= $(window).width();
	$h= $(window).height();

	if($h > (1.2 * $w)){
		$('#tall').show();
		$('#wide').hide();
	}
	else{
		$('#tall').hide();
		$('#wide').show();	
	}

	 $(window).on('resize', function(){
	 	$w= $(window).width();
		$h= $(window).height();

		if($h > (1.2 * $w)){
			$('#tall').show();
			$('#wide').hide();
		}
		else{
			$('#tall').hide();
			$('#wide').show();	
		}
	 });

});